import React from "react"

import Filmovi from "./Filmovi"
import NoviFilm from "./NoviFilm"
import Users from "./Users"
import NovaProjekcija from "./NovaProjekcija"
import Projekcije from "./Projekcije"

function Main(props){

    const noviFilm=props.state.NoviFilm === true && <NoviFilm handleToUpdateAdd={props.handleToUpdateAdd} filmovi={props.state.filmovi}/>
    const users=props.state.Users === true && <Users />
    const projekcije=props.state.idProjekcije === true && <Projekcije state={props.state}/>
    const novaProjekcija=props.state.NovaProjekcija === true && <NovaProjekcija handleToUpdateAddProjekcije={props.handleToUpdateAddProjekcije} state={props.state}/>
    return(
        <div id="main">
            <Filmovi handleToUpdateDelete={props.handleToUpdateDelete} state={props.state} />
            {noviFilm}
            {users}
            {projekcije}
            {novaProjekcija}
        </div>
    )
}

export default Main
